export default class FooterSection extends Component {
    constructor(props) {
        super(props)

    }

    render() {
        return (
            <div className="FooterContainer">
                <div className="LeftFooter">
                    <div className="ExidioLogo" />
                </div>
                <div className="RightFooter">

                </div>
            </div>
        )
    }
}
